    int lo = 0;
    int hi = arr.length;
    while (lo < hi) {
        int mid = lo + (hi - lo) / 2;
        if (arr[mid] == x) {
            return mid;
        } else if (arr[mid] < x) {
            lo = mid + 1;
        } else {
            hi = mid;
